(282, 234, 'Morfars Havehus', '1,4,5,7', '0', '2022-06-12', '2022-06-12', '10:00:00', '16:00:00', 'Vores lille loppebiks har åben den anden søndag i hver måned. \nVi har mante fine ting til en god pris og vi er altid villige til at prutte om prisen. Det er det der er sjovt\nDen 12/6 giver vi folk mulighed for at komme og sætte en stand op hos os. \nDet koster 100 kr. incl. i prisen er der morgen mad,  frokost, kaffe og kage. \nMan skal selv have borde osv med. \nSend os gerne en sms, hvis du skal være med.', 'Mosevænget', '11', '8722', 'Hedensted', 'Vivi List', '53706917', 'listvivi@gmail.com', '0', '1', '0', '0', '0', 'Open', '2022-05-15 15:20:51', '2022-05-16 11:28:08', '9.696042', '55.7718882'),
