(388, 1405, 'Little Reusers', '5,9,10', '0', '2022-06-28', '2030-06-28', '09:00:00', '17:30:00', 'Dit loppeunivers med alt til børn!\r\nLittle Reusers har i al sin enkelthed forsøgt at skabe et koncept som tilgodeser alle.\r\n\r\nSælg ud af jeres børnetøj, barnevogne, autostol, tremmeseng, højstol, legetøj:\r\nDU leverer varerne og VI betjener kunderne – nemmere bliver det ikke.\r\n\r\nVi tilbyde både HELE og HALVE stande – og alle vores stande kan deles med én eller flere.\r\n\r\nDu kan også leje dig ind på en gulvplads til vogne eller større udstyr/legesager.\r\n\r\nhttps://www.littlereusers.dk/', 'Hjørringvej 28', NULL, '9400', 'Nørresundby', 'Anne eller Christina', '31 13 90 95', 'info@littlereusers.dk', '', '1', '0', '0', '0', 'Open', '2022-06-28 10:29:07', '2022-06-28 17:29:56', '', ''),
(389, 1406, 'Reusers', '5', '0', '2022-06-28', '2030-06-28', '10:00:00', '17:30:00', 'Reusers er dit REUSEunivers med alt til kvinder, hvor vi gør det nemt og bekvemt at sælge ud af dit klædeskab – tøj, sko, smykker og accessories – og for kunderne at købe ‘nyt’ reuse.\r\n\r\nReusers har i al sin enkelthed, skabt et univers af kvinder – til kvinder.\r\n\r\nKonceptet er enkelt:\r\n\r\nDu leverer varerne – vi sælger dem. Nemmere bliver det ikke!\r\n\r\nhttps://reusers.dk/\r\n', 'stenbukken 3b', NULL, '9200', 'aalborg sv', 'Anne eller Christina', '3113 9096', 'info@reusers.dk', '', '1', '0', '0', '0', 'Open', '2022-06-28 10:56:59', '2022-06-28 17:29:48', '9.887298095655224', '57.00595653512795'),
