(408, 621, 'Skottemarked ', '1,3,4,5,7,8,9,10,11', '0', '2022-09-03', '2022-09-03', '09:00:00', '18:00:00', 'FDF Korsvejen har atter den store fornøjelse at arrangere et kræmmermarked i anledning af Skottegårdens Butikscenters årlige høstfest lørdag d. 3. september kl. 09.00 -18.00.\r\n\r\nCentret ligger på hjørnet af Kastrupvej og Saltværksvej i Kastrup, hvor vi laver et hyggeligt familiemarked i lighed med Korsvejsmarked. Noget mindre men mindst ligeså hyggeligt:-)\r\n\r\nDer vil være underholdning i alle gårdene i centret som har en lang række gode tilbud på dagen og arrangementet bliver markedsført i lokalpressen.\r\n\r\nStadepladser:\r\nB-F, parkeringsbåse på ca. 2,5 x 5  m, salgssiden er den korte side. Pris pr. plads kun kr. 300,-.\r\nG, Fortov samt starten af Kastrupvej er ca. 5 x 2,5 m, salgssiden er den lange side.\r\nPris pr. plads i G-rækken er kun kr. 400,-.\r\nH, Kastrupvej langs centret er ca. 5 x 4 m, salgssiden er den lange side. Pris pr. plads kun kr. 500,-.\r\nEn hjørneplads koster kr. 100,- ekstra,\r\n220 V koster kr. 300,- ekstra.\r\n\r\nMarkedet afvikles på pladsen bag Kastrup Bio og langs Kastrupvej. \r\n\r\nBemærk at alle stadepladser er på fast belægning, ikke jord!!\r\n\r\nDer kan rigges til fra kl. 0700 på selve dagen. Klokken 2000 skal kræmmerne have ryddet op og have fjernet affald og usolgte ting.\r\n\r\nI tiden kl. 0900 - 1800 er biler forbudt på markedspladsen.\r\n\r\nDer er arrangeret særlige parkeringsmuligheder for kræmmerne inden for ca. 100 m i Skottegårdsskolens skolegård. \r\n\r\nSalg af mad, slik og drikkevarer må ikke finde sted. Salg af lotteri og spil skal aftales med markedsudvalget\r\n\r\nDer serveres GRATIS morgenkaffe med rundstykke til kræmmerne i tiden kl. 0700 til 0900.\r\n\r\nDu kan booke en stade herunder, og kortet kan ses sammen med billederne. Er der spørgsmål eller ønsker så skriv til info@korsvejsmarked.dk. ', 'Skottegården 10', '', '2770', 'Kastrup', 'Hanne Præst', '52242051', 'info@korsvejsmarked.dk', '0', '0', '0', '0', '0', 'Open', '2022-08-07 11:59:22', '2022-08-21 08:44:09', '12.6342918', '55.638782'),
