(410, 165, 'Stort vejloppemarked i Vanløse', '1,2,3,4,5,9,10,11,12', '0', '2022-08-27', '2022-08-27', '10:00:00', '14:00:00', '', 'Bangsbo Plads', 'Tom', '2720', 'København', '', '', '', '0', '1', '0', '0', '0', 'Open', '2022-08-11 14:20:21', '2022-08-12 06:58:46', '12.4939805', '55.691377'),
(411, 888, 'Loppemarked i anlægget i Assens over 20 har booket stande', '1,5,10,11', '0', '2022-08-13', '2022-08-13', '10:00:00', '15:00:00', '', 'Søndergade / Storegade Anlægget i Assens', '', '9550', 'Mariager', '', '', '', '0', '1', '0', '0', '0', 'Open', '2022-08-13 05:28:16', '2022-08-13 08:19:26', '10.0611119', '56.6771703'),
(412, 8, 'test 3', '3,4,5', '0', '2022-08-19', '2022-08-20', '10:00:00', '16:00:00', 'test\r\n\r\nDer er 80stadepladser som kan bookes herunder.\r\nVi har 3 slags stadepladser, til tre priser.\r\nHjørneborderne koster 500,- og er 4x4 meter.\r\nDe mindre stadepladser koster 300, dem er der 25 stk. af', 'Skottegården', NULL, '2770', 'Kastrup', '', '', '', '', '0', '0', '0', '0', 'Open', '2022-08-16 16:19:01', '2022-08-16 17:00:55', '', ''),
(413, 1541, 'Loppemarked i lundegården', '3,4,5,6,9,10', '0', '2022-08-21', '2022-08-21', '10:00:00', '15:00:00', '', 'Hestens Kvarter', '33', '2750', 'Ballerup', '', '', '', '0', '1', '0', '0', '0', 'Open', '2022-08-19 16:30:06', '2022-08-20 16:48:01', '12.359623', '55.738639'),
(414, 621, 'FDF Skottemarked', '', '0', '2022-09-03', '2022-09-03', '09:00:00', '18:00:00', 'FDF Korsvejen arrangerer i samarbejde med Hovedbiblioteket et julemarked på Rådhuspladsen… altså Tårnby Rådhusplads, på Amager Landevej 76. ????\r\n\r\n\r\nDet er et kræmmermarked med masser af julestemning, som finder sted lørdag den 27. november kl. 1000-1600.\r\n\r\n\r\nDer vil naturligvis - udover kræmmere - være salg af glögg og æbleskiver, øl og vand, kaffe og te og ikke mindst noget varmt at spise.\r\n\r\n\r\nDer kommer naturligvis en julemand og underholder, der vil være bålfade med varme kul, halmballer, salg af juletræer, julesange, og ikke mindst en borgmester, der tænder juletræet på rådhuspladsen fra toppen af brandvæsenets stige!\r\n\r\n\r\nMarkedet bliver markedsført i lokalaviserne, på facebook, på standere ved busstoppe-stederne og på kommunens info-tavler.\r\n\r\nDa vejr og temperatur kan være anderledes end vores marked i juni har vi valgt at tilbyde at man kan tilkøbe en delvis overdækning på 3 x 3 meter således at en del af pladsen er i læ. Borde skal man selv medbringe.\r\n\r\n\r\nStadepladser er som på kortet:\r\n\r\n    A, B, C og E er parkeringsbåse på ca. 3 x 5 m, salgssiden er den korte side. Pris pr. plads kun kr. 300,-.\r\n    D er parkeringsbåse som er omgivet af høje kanter på de tre sider, og derfor er målene 2,80 i bredden og 4,80 i længden. De er omgivet af lave træer, og der kan derfor umiddelbart ikke stå en pavillon. Man er dog velkommen til at indrette sig med parasoller eller presenninger. Pris pr. plads kun kr. 250,-.\r\n    Ønsker man overdækning på 3 x 3 m, så kan det tilkøbes for kr. 300,-.\r\n    En hjørneplads koster kr. 100,- ekstra.\r\n    220 V koster kr. 200,- ekstra.\r\n\r\n \r\n\r\nBemærk at alle stadepladser er på fast belægning, ikke jord! Der kan rigges til fra kl. 0700 på selve dagen. Klokken 1800 skal kræmmerne have ryddet op og have fjernet affald og usolgte ting. I tiden 0900-1600 er biler forbudt på markedspladsen.\r\n\r\n\r\nDer er parkeringsmuligheder for kræmmerne bag rådhuset (indkørsel fra Østerlarsvej) samt langs Korsvejens Skole (indkørsel fra Tårnbyvej) og bag ”Postkassen” (indkørsel fra Sirgræsvej).\r\n\r\n\r\nSalg af mad, slik og drikkevarer m.v. må ikke finde sted på markedspladsen. Der kan etableres strøm efter nærmere aftale.\r\n\r\n \r\n\r\nDer serveres naturligvis GRATIS morgenkaffe med rundstykke til kræmmerne i tiden kl. 0700 og 0900.\r\n\r\nDu reserverer en stadeplads HER og har du spørgsmål kan du skrive på info@korsvejsmarked.dk eller ringe på telefon 5224 2051 på hverdage efter kl. 1700. Så sender vi en bekræftelse med opkrævning af stadeafgiften. Reservationen er først gyldig, når vi har modtaget betalingen.\r\n', 'Skottegården 2', NULL, '2770', 'Kastrup', 'Hanne Præst', '52242051', 'info@korsvejsmarked.dk', '', '1', '0', '0', '0', 'Open', '2022-08-21 08:44:16', '2022-08-21 08:44:26', '12.635221481323242', '55.638328025258524');
