INSERT INTO `rudra_settings` (`id`, `st_key`, `st_meta`, `dnk_meta`, `status`, `is_deleted`, `added_on`, `updated_on`) VALUES
(1, 'aboutus', '<p>Find the best flea markets and second-hand shops in Denmark. We love exploring used items.<br>\r\n<br>\r\nThings will get a new life, you save money and so the most important thing: No new products don’t need to be produced, so we help the environment!<br>\r\n<br>\r\nOur goal is to create a universe for all recycling, so it is easy and smart to shop used things. Everyone should be able to find markets and shops in the easiest way.<br>\r\n<br>\r\nIt provides more customers to the markets and stores, which increases the amount of recycled items, and it will lowering the demand for new products!</p>\r\n\r\n<p><img alt=\"\" src=\"https://loppekortet.dk/assets/img/who_we_are.png\"></p>\r\n\r\n<p><strong>General info: </strong></p>\r\n\r\n<p>Once you have created your market, the Flea Card must approve it before it appears others can see it.</p>\r\n\r\n<p><strong>Loppekortet: </strong> It&#39;s great when others have found your flea market or thrift store and put it on the flea card. But the best advertising for a flea market, is made by those who have the market! The next best thing is that it&#39;s there!</p>\r\n\r\n<p>Then we already have the market on the Flea Card, so create your market, with pictures and descriptions, send us an email and we will remove the other! The better the description and the more pictures, the more customers will come by!</p>\r\n\r\n<p><strong>Sell tables: </strong></p>\r\n\r\n<p>We have developed an automatic way to sell tables to provide a better overview for everyone which sells tables.</p>\r\n\r\n<p>Then you can spend the time on other things!</p>\r\n\r\n<p>After you have set up your flea market, you can put your tables for sales. You can choose between small, medium, and large size (it can be the table price or the size of a table). You can set the number and price of the three categories. You can post a picture of each of your categories (tables or the stall itself) In your market, you put an overview of all the tables, with numbers on and whether it is small, medium, or large, or you can choose a color for each of them. (Then just sign the creation of the tables or in your description of the market that the small tables are marked as green, the medium ones are yellow, and the large ones are red) After you have put them up for sale, the shopkeepers can then buy the tables that you have for sale.</p>\r\n\r\n<p>Most often you have the same price on your tables but have set the corner tables at a higher price they can one then set to medium. When they are sold, it is then table 1 in each category that is sold first. When a shopkeeper buys a table, he gets a receipt online which shows which table you have purchased. Meanwhile, the seller gets a notice of the sale, which table as well as information on the buyer.</p>\r\n\r\n<p>When the tables are sold, you can keep track of the number of tables left, as well as what you have served.</p>\r\n\r\n<p>In the end, just look at the list of sold tables, then you know who is coming.</p>\r\n\r\n<p>Easy, clear, and smart!</p>\r\n\r\n<p><strong>Questions?: </strong> If you have any questions or are looking for some tips or advice, write to us.</p>\r\n\r\n<p>Then we help!</p>\r\n', '<p>Vi elsker selv at udforske markeder eller butikker med gamle brugte ting.</p>\r\n\r\n<p>Men vi synes at det var rigtig svært at få et overblik over hvor og hvornår der var markeder rundt omkring i danmark. Både dem som var lige i nærheden, eller hvis man alligevel skulle en tur til Fyn eller Jylland.</p>\r\n\r\n<p>Derfor tænkte vi at det burde kunne gøres smartere og nemmere - og det kunne det godt!</p>\r\n\r\n<p>Hjemmesiden er naturligvis et must, men det som vi gerne ville er det som man kan i appen, her kan man nemlig nemt og overskueligt kigge på appens kort og se hvilke marekder der er lige i nærheden eller lave en rute så man kan komme godt rundt, til både de store og små markeder der er i hele landet!</p>\r\n\r\n<p>Vi håber i kan bruge den og at i vil lægge alle de markeder op som i finder eller selv skal afholde, så vi kan genbruge så meget som overhovedet muligt og hjælpe med at passe på naturen!</p>\r\n\r\n<p><br>\r\n<br>\r\nWin-Win<br>\r\n<br>\r\nVi håber at kunne give flere kunder til markederne og butikkerne, hvilket øger mængden af genbrugsgenstande, og det vil mindske efterspørgslen efter nye produkter!</p>\r\n\r\n<p><img alt=\"\" src=\"https://loppekortet.dk/assets/img/who_we_are.png\"></p>\r\n\r\n<p><strong>Generel info: </strong> Du kan benytte Loppekortet helt gratis, men så er der nogle begrænsninger. For at kunne betale for udvikling, fornyelse og ikke mindst at der ikke er en masse reklamer, så er vi afhængige af at der er en lille brugerbetaling. Dvs. at du gratis kan finde loppemarkeder i hele danmark, samt lægge loppemarkeder op, men uden så mange oplysninger.</p>\r\n\r\n<p> </p>\r\n\r\n<p>Når du har oprettet dit marked, så skal Loppekortet godkende det inden det kommer frem så andre kan se det.</p>\r\n\r\n<p><strong>Loppekortet: </strong> Det er skønt når andre har fundet dit Loppemarked eller genbrugsbutik og lagt det på Loppekortet. Men den bedste reklame for et Loppemarked, laves af dem som har markedet! Det næstbedste er, at det er der!</p>\r\n\r\n<p>Så har vi allerede markedet på Loppekortet, så opret dit marked, med billeder og beskrivelser, send os en mail og så fjerne vi det andet! Jo bedre beskrivelse og flere billeder, jo flere kunder vil komme forbi!</p>\r\n\r\n<p><strong>Stadepladser: </strong></p>\r\n\r\n<p>Vi har udviklet en automatisk måde at sælge stadepladser på, for at give et bedre overblik til alle som sælger stadepladser.</p>\r\n\r\n<p>Så kan man bruge tiden på en masse andet!</p>\r\n\r\n<p>Efter man har oprettet sit loppemarked, så kan man sætte sine stadepladser til salg på Loppekortet.</p>\r\n\r\n<p>Du kan vælge mellem lille, medium og stor størrelse (det kan være bordene eller selve pladsen).</p>\r\n\r\n<p>Du kan sætte antal og pris på de tre kategorier.</p>\r\n\r\n<p>Du kan lægge et billede op, af hver af dine kategorier (borde eller selve stadepladsen)</p>\r\n\r\n<p>På dit marked lægger du et oversigtsbillede af alle stadepladserne, med numre på og om det er lille, medium eller stor, eller du kan vælge en farve til hver af dem. (så skriver du blot under oprettelsen af boderne eller i din beskrivelse af markedet at de små stadepladser er markeret som grønne, de medium er gule og de store er røde)</p>\r\n\r\n<p>Efter du har sat dem til salg, så kan kræmmerne så købe de borde som du har til salg.</p>\r\n\r\n<p>Oftest har man samme pris på sine borde, men har sat hjørnebordene til en højere pris, dem kan man så sætte til medium.</p>\r\n\r\n<p>Når de bliver solgt, så er det så bord 1 i hver kategori som bliver solgt først.</p>\r\n\r\n<p>Når en kræmmer køber et bord, så får han en kvittering online som viser hvilket bord man har købt. Imens får sælger en notits om salget, hvilket bord samt oplysninger på køber.</p>\r\n\r\n<p>Når bordene bliver solgt, kan man følge med i antallet af borde der er tilbage, samt hvad man har tjent.</p>\r\n\r\n<p>Til sidst er det blot at kigge på oversigten over solgte borde, så ved man hvem som kommer.</p>\r\n\r\n<p> </p>\r\n\r\n<p>Nemt, overskueligt og smart!</p>\r\n\r\n<p> </p>\r\n\r\n<p><strong>Spørgsmål?: </strong> Hvis der er spørgsmål, eller man søger nogle fif eller gode råd så skriv til os.</p>\r\n\r\n<p>Så hjælper vi!</p>\r\n', '1', '0', '2021-10-30 11:38:19', '2022-05-24 11:55:48'),
(2, 'termsofservices', '<!DOCTYPE html>\n<html>\n<head>\n<title>Terms Of Services</title>\n</head>\n<body>\n\n<b>Scope of the agreement</b><br>\n<b>Loppekortet mediates the booking of stalls.</b><br>\n<b>Loppekortet is not responsible for the organization of the market.</b><br>\n<b>Markets:</b><br>\n<p>The organizer agrees that the Flea Market keeps information about the organizer and the organizer\'s markets. Company information is not shared with customers or third parties. Market information is published on loppekortet.dk for city owners and market visitors, and the organizer is responsible for the correctness and completeness of this information. The market organizer is free to change its own markets if no stadium bookings have yet been confirmed. Once one or more stadium bookings have been made, it is not possible to change the market page. The flea market cannot be held responsible for lost data due to system crashes, failures in subcontractors\' systems or similar.</p>\n<b>Market information:</b>\n<p>The market organizer is responsible for ensuring that the material used by the market organizer, e.g. text and images, does not infringe the rights of third parties. The Flea Market cannot be held liable for the market organizer’s material and the market organizer is obliged to indemnify the Flea Market in all respects for any costs incurred in connection with possible infringements.</p>\n<b>Cancellation:</b>\n<p>Should the market organizer find it necessary to cancel a market, the market organizer must notify the Flea Market as soon as possible. This must be done before the scheduled start of the market and within a reasonable time. The Flea Market will then refund the money paid by the bookers as soon as possible. The Flea Card fee and payment charges will not be refunded.</p>\n<b>Prices and fees:</b>\n<p>The market organizer sets the entry prices for the market and the prices for each stand at the market. The Flea Card will charge a fee to the bookers of the stands, which will accrue exclusively to the Flea Card. The following fees apply to market bookings through the Flea Card:</p>\n<b>Stadium price Flea Card fee:</b>\n<p>The card/payment fee is automatically charged through the Quickpay payment system. This fee is charged by the redeemers NETS for Dankort and Clearhaus for VISA and MasterCard and will automatically be the fee set by the redeemer. Find out more at www.nets.dk and www.clearhaus.com respectively.</p>\n\n<b>Settlement:</b>\n<p>When booking a market stall, the Flea Card will receive payment from the stall booker. Loppekortet will pay the market price to the market organiser, provided that the market has been held and the purchase has been made. The payment is due within 3 working days after the end of the market. In the event of cancellation, the Market Card shall be able to reimburse the Stadium Booker\'s payment and final payment to the Market Organiser shall therefore be made after the Market has taken place.</p>\n<b>Cancellation:</b>\n<p>If the market organizer does not carry out the market, the market organizer, the bankruptcy estate of the market organizer or the person(s) to whom the market organizer may have transferred the rights under this contract shall not be entitled to any remuneration for the cancelled/non-carried out market(s) and the Flea Market shall refund the purchase price minus ticket and payment fees to the market buyers. The market organizer cannot claim any amount from either the Flea Market or the city buyers in respect of markets not held unless they are directly responsible for the cancellation. The Flea Market is not obliged to pay interest on any amount to either the market organizer or the city buyers.</p>\n<b>Liability:</b>\n<p>The Flea Market is solely responsible for arranging the booking of stall space.</p>\n<p>The Flea Market is not responsible for the organization of the market and assumes no liability towards the market buyers for the actions of the market organizers.</p>\n<p>The market organizer alone is responsible for the accuracy and legality of the information entered on the market organizer website www.loppekortet.dk. Should the Flea Market receive a charge from NETS, TELLER or any other payment processor for reimbursement of card payments, the amount will be charged to the Market Organizer and the amount will be set off against the Market Organizer outstanding balance. If the Market Organizer has no outstanding balance with the Flea Card, the Market Organizer shall pay the Flea Card the invoiced amount within 7 days.</p>\n<p>PAYMENT is made immediately after confirmation of the order.</p>\n<p>Remember to add details of name and market when paying.</p>\n<p>In case of cancellation later than 30 days before the registered market, 50% of the market fee will be refunded. Cancellations later than 15 days before the registered market will not be refunded.\nWhen you enter into an agreement with Loppekortet regarding the price of your ticket to our Flea and Flea Market, you simultaneously consent to us collecting, registering, storing, and processing your personal data in accordance with the Personal Data Act. This concerns your name, address, telephone number, e-mail address and CVR number (if applicable). You can at any time view the information we hold about you, and you can always ask us to delete and/or correct information.</p>\n\n</body>\n</html>\n', '<!DOCTYPE html> \n<html> \n<head> \n	<title>Servicevilkår</title> \n</head> \n<body>  \n	<b>Aftalens omfang:</b><br>\n	<b>Loppekortet formidler booking af stadepladser.</b><br>\n	<b>Loppekortet er ikke ansvarlige for afholdelse af markedet.</b><br>\n	<b>Markeder:</b><br>\n	<p>Arrangøren accepterer, at Loppekortet opbevarer information om arrangøren og arrangørens markeder. Virksomhedsinformation bliver ikke delt med kunder eller tredjepart. Markedsinformation offentliggøres på loppekortet.dk til stadelejere og markedsgæster, og arrangøren har ansvaret for, at denne information er korrekt og fyldestgørende. Markedsarrangøren kan frit ændre i egne markeder, hvis der endnu ikke er bekræftet nogen stadebookinger. Når en eller flere stadebookinger er gennemført er det ikke muligt at ændre i markedssiden. Loppekortet kan ikke gøres ansvarlig for mistede data grundet systemnedbrud, svigt i underleverandørers systemer eller lign.</p>\n	<b>Markedsinformation:</b>\n	<p>Markedsarrangøren er ansvarlig for, at markedsarrarrangørens anvendte materiale, f.eks. tekst og billeder ikke krænker tredjemands rettigheder. Loppekortet kan ikke drages til ansvar for markedsarrangørens materiale, og markedsarrangøren har pligt til i enhver henseende at skadesløsholde Loppekortet for enhver omkostning i forbindelse med mulige retskrænkelser.</p>\n	<b>Aflysning:</b>\n	<p>Skulle markedsarrangøren finde det nødvendigt at aflyse et marked skal markedsarrangøren hurtigts muligt gøre Loppekortet opmærksom på dette. Det skal ske inden markedets planlagte start og inden for rimelig tid. Loppekortet vil derefter tilbageføre stadebookeres penge så hurtigt som muligt. Loppekortets gebyr og betalingsgebyrer tilbageføres ikke.</p>\n	<b>Priser og gebyrer:<b>\n	<p>Markedsarrangøren fastsætter selv markeders indgangspriser og priserne for hver enkelt stade på det pågældende marked. Loppekortet opkræver et gebyr hos stadebookere, der alene tilfalder Loppekortet. Følgende gebyrer gælder for markedsbooking gennem Loppekortet:</p>\n	<b>Stadepris	 Og Loppekortets gebyr:</b>\n	<p>Kort-/betalingsgebyr opkræves automatisk gennem betalingssystemet Quickpay. Dette gebyr opkræves af indløserne NETS for Dankort og Clearhaus for VISA og MasterCard og vil automatisk være det af indløseren fastsatte gebyr. Find mere på hhv. www.nets.dk og www.clearhaus.com.</p>\n	<b>Afregning:</b>\n	<p>Ved booking af markedsstader modtager Loppekortet betaling fra stadebookeren. Loppekortet udbetaler den betalte stadepris til markedsarrangøren, under forudsætning af at markedet er afholdt og købet er effektueret. Udbetalingen forfalder til betaling inden for 3 arbejdsdage efter markedets afslutning. Loppekortet skal i tilfælde af aflysning kunne refundere stadebookerens betaling, og endelig udbetaling til markedsarrangøren foretages derfor efter markedets gennemførelse.</p>\n\n\n	<b>Aflysning:</b>\n	<p>Såfremt markedsarrangøren ikke gennemfører markedet, er markedsarrangøren, markedsarrangørens konkursbo eller den eller de som markedsarrangøren måtte have overført rettighederne til i henhold til denne kontrakt ikke berettiget til noget vederlag for det/de aflyste/ikke gennemførte markeder, og Loppekortet refunderer købesummen med fradrag af billet- og betalingsgebyrer til stadekøberne. Markedsarrangøren kan ikke rejse krav overfor hverken Loppekortet eller stadekøberne om betaling af noget beløb i anledning af ikke afholdte markeder medmindre disse er direkte skyld i aflysningen. Loppekortet er ikke forpligtet til at forrente noget beløb over for hverken markedsarrangøren eller stadekøberne.</p>\n	<b>Ansvar:</b>\n	<p>Loppekortet er alene ansvarlige for at formidle booking af stadeplads.</p>\n	<p>Loppekortet er ikke ansvarlige for afholdelse af markedet og påtager sig intet ansvar over for stadekøberne for markedsarrangørenes gøren.</p>\n	<p>Markedsarrangøren alene er ansvarlig for rigtigheden og lovligheden af de oplysninger, der indtastes på markedsarrangørens marked på www.loppekortet.dk. Skulle Loppekortet modtage opkrævning fra NETS, TELLER eller anden betalingsformidler på tilbagebetaling af kortbetaling, viderefaktureres beløbet til markedsarrangøren, og beløbet modregnes i markedsarrangørens tilgodehavende beløb. Såfremt markedsarrangøren ikke har noget tilgodehavende beløb hos Loppekortet skal markedsarrangøren inden 7 dage betale Loppekortet det fakturerede beløb.</p>\n \n	<p>BETALING foretages umiddelbart efter bekræftelse af bestilling.</p>\n	<p>Husk at tilføje oplysninger om navn og marked når du betaler.</p>\n	<p>Ved afbud senere end 30 dage før det tilmeldte marked refunderes 50% af stadelejen. Ved afbud senere end 15 dage før det tilmeldte marked refunderes stadelejen ikke.</p>\n	<p>Når du indgår aftale med Loppekortet omkring stadeleje til vore Loppe- og Kræmmermarkeder, giver du samtidige samtykke til, at vi må indsamle, registrere, opbevare og behandle dine personoplysninger i henhold til persondatalovgivningen. Det drejer sig om navn, adresse, telefonnummer, mailadresse og evt. CVRnr. Du kan til enhver tid få indsigt i hvilke oplysninger vi har om dig, ligesom du altid kan få os til at slette og/eller rette oplysninger.</p>\n\n</body> \n</html>', '1', '0', '2021-10-30 11:40:08', '2022-02-09 16:47:55'),
(3, 'faq', '<p>[{\"title\":\"How do I choose a package when I want to buy?\",\"details\":\"You must choose what you need, if you want to see the markets there are in Denmark, then you can do it for free and can cycle there and buy some good things. If you have a greater need, would like the opportunity to be able to make favourites and search for e.g., vinyl records throughout the country, then you can expand to the package 19DKK per month. And of course, there is no binding!\"},{\"title\":\"Do I have to buy a package to sell?\", \"details\":\"No, you don’t have to. You can create both your market and your store on the Flea Card for free. The packages you can buy as a seller, allow for a lot of initiatives that give increased attention around you, which gives more customers. There is also a repeat function, pictures, video and much more.\"}]</p>\n', '<p>[{\"title\":\"Hvordan vælger jeg en pakke, når jeg vil købe?\",\"details\":\"Du skal vælge, hvad du har brug for, hvis du vil se de markeder, der er lige omkring dig og i hele Danmark, så kan du gøre det gratis og kan cykle derned og købe nogle gode ting Har du et større behov, gerne vil have mulighed for at kunne lave favoritter og søge på fx vinylplader i hele landet, så kan du udvide til enten pakken til 19DKK om måneden. Og selvfølgelig er der ingen binding!\"},{\"title\":\"Skal jeg købe en pakke for at sælge?\", \"details\":\"Nej, det behøver du ikke. Du kan gratis oprette både dit marked og din butik på Loppekortet Pakkerne du kan købe som sælger giver mulighed for en masse tiltag, der giver øget opmærksomhed omkring dig, hvilket giver flere kunder Der er også en gentagelsesfunktion, billeder, video og meget mere.\"}]</p>\r\n', '1', '0', '2021-11-03 10:22:34', '2022-05-31 12:41:14'),
(4, 'howitworks', '[{\"url\":\"https:\\/\\/www.loppekortet.dk\\/uploads\\/howitworks\\/hiw.mp4\",\"thumbnail\":\"https:\\/\\/www.loppekortet.dk\\/uploads\\/default_market.jpg\",\"description\":\"</p>\n\n<p> </p>\n\n<p> </p>\n\n<p>Here you can see how to use the different options in the Flea Card. The functions in the flea card will be available in the various packages you can subscribe to.<br>\n<br>\n<strong>Search and find your markets and shops.</strong><br>\nThere are different ways to search for what you would like to see.</p>\n\n<ul>\n <li>You can decide in what radius to search on the map to narrow your search.</li>\n <li>On the map you can see everything that lies of markets and shops.</li>\n <li>Then you can decide where you would like to go.</li>\n <li>You can tap the icons on the map</li>\n <li>Here you can see their information, photos, video and much more.</li>\n</ul>\n\n<p><br>\n<strong>It is possible to search for what you want.</strong><br>\nIf you collect on seagull frame or old vinyl records, then you can search for this in the search field. The markets and shops that have these things will then come forward and then you can go there, to see if you can make a good deal.<br>\n<br>\n<strong>Create market or store.</strong><br>\nYou can create your market quite easily.<br>\n<br>\nThe more information you write about your market, the more interested customers you can attract.<br>\n<br>\nThere are general categories you can choose, so it fits to your market, you also have the opportunity to describe in a text field what you have and other information.Since customers can search in everything you write, as much information as possible will give more interested.<br>\n<br>\nIt is possible to upload pictures and video, so you can easily show which market you have, so your customers can see how much children&#39;s clothes or toys you have for sale.</p>\n\n<p> </p>\n\n<p>\"}]\n', '[{\"url\":\"https:\\/\\/www.loppekortet.dk\\/uploads\\/howitworks\\/hiw.mp4\",\"thumbnail\":\"https:\\/\\/www.loppekortet.dk\\/uploads\\/default_market.jpg\",\"description\":\"</p>\n\n<p> </p>\n\n<p>Her kan du se, hvordan du bruger de forskellige muligheder i Loppekortet. Funktionerne i loppekortet vil være tilgængelige i de forskellige pakker, du kan abonnere på.<br>\n<br>\n<strong>Søg og find dine markeder og butikker.</strong><br>\nDer er forskellige måder at søge efter det, du gerne vil se.</p>\n\n<ul>\n <li>Du kan bestemme i hvilken radius du vil søge på kortet for at indsnævre din søgning.</li>\n <li>På kortet kan du se alt, hvad der ligger af markeder og butikker.</li>\n <li>Så kan du bestemme, hvor du vil hen.</li>\n <li>Du kan trykke på ikoner på kortet</li>\n <li>Her kan du se deres informationer, billeder, video og meget mere.</li>\n</ul>\n\n<p><br>\n<strong>Det er muligt at søge efter det, man ønsker.</strong><br>\nSamler du på mågestel eller gamle vinylplader, så kan du søge på dette i søgefeltet. De markeder og butikker, der har disse ting, vil så komme frem, og så kan du gå derhen, for at se, om du kan gøre en god handel.<br>\n<br>\n<strong>Opret marked eller butik.</strong><br>\nDu kan nemt oprette dit marked.<br>\n<br>\nJo mere information du skriver om dit marked, jo flere interesserede kunder kan du tiltrække.<br>\n<br>\nDer er generelle kategorier du kan vælge, så det passer til dit marked, du har også mulighed for i et tekstfelt at beskrive hvad du har og andre oplysninger. Da kunderne kan søge i alt hvad du skriver, vil så meget information som muligt give mere interesseret.<br>\n<br>\nDet er muligt at uploade billeder og video, så du nemt kan vise hvilket marked du har, så dine kunder kan se hvor meget børnetøj eller legetøj du har til salg.</p>\n\n<p> </p>\n\n<p>\"}]\n', '1', '0', '2021-11-03 12:37:09', '2022-05-31 12:32:00'),
(6, 'privacypolicy', '<!DOCTYPE html>\n<html>\n<head>\n<title>Terms Of Services</title>\n</head>\n<body>\n\n<b style=\"font-weight: 600 !important;\">Privacy Policy</b><br>\n\n<p>Skattekortet built the loppekortet app as an Open Source app. This SERVICE is provided by Skattekortet at no cost and is intended for use as is.</p>\n\n<p>This page is used to inform visitors regarding our policies with the collection, use, and disclosure of Personal Information if anyone decided to use our Service.</p>\n\n<p>If you choose to use our Service, then you agree to the collection and use of information in relation to this policy. The Personal Information that we collect is used for providing and improving the Service. We will not use or share your information with anyone except as described in this Privacy Policy.</p>\n\n<p>The terms used in this Privacy Policy have the same meanings as in our Terms and Conditions, which are accessible at loppekortet unless otherwise defined in this Privacy Policy.</p>\n\n<b>Information Collection and Use</b><br>\n\n<p>For a better experience, while using our Service, we may require you to provide us with certain personally identifiable information, including but not limited to name,email,profile. The information that we request will be retained by us and used as described in this privacy policy.</p>\n\n<p>The app does use third-party services that may collect information used to identify you.<p>\n\n<p>Link to the privacy policy of third-party service providers used by the app</p>\n\n<ul>\n   <li>Google Play Services</li>\n   <li>Google Analytics for Firebase</li>\n   <li>Firebase Crashlytics</li>\n   <li>Facebook</li>\n</ul>\n<br>\n<b>Log Data</b><br>\n\n<p>We want to inform you that whenever you use our Service, in a case of an error in the app we collect data and information (through third-party products) on your phone called Log Data. This Log Data may include information such as your device Internet Protocol (“IP”) address, device name, operating system version, the configuration of the app when utilizing our Service, the time and date of your use of the Service, and other statistics.</p>\n\n<b>Cookies</b><br>\n\n<p>Cookies are files with a small amount of data that are commonly used as anonymous unique identifiers. These are sent to your browser from the websites that you visit and are stored on your device\'s internal memory.</p>\n\n<p>This Service does not use these “cookies” explicitly. However, the app may use third-party code and libraries that use “cookies” to collect information and improve their services. You have the option to either accept or refuse these cookies and know when a cookie is being sent to your device. If you choose to refuse our cookies, you may not be able to use some portions of this Service.</p>\n\n<b>Service Providers</b><br>\n\n<p>We may employ third-party companies and individuals due to the following reasons:<p>\n\n<ul>\n   <li>To facilitate our Service;</li>\n   <li>To provide the Service on our behalf;</li>\n   <li>To perform Service-related services; or</li>\n   <li>To assist us in analyzing how our Service is used.</li>\n</ul>\n\n<p>We want to inform users of this Service that these third parties have access to their Personal Information. The reason is to perform the tasks assigned to them on our behalf. However, they are obligated not to disclose or use the information for any other purpose.</p>\n\n<b>Security</b><br>\n\n<p>We value your trust in providing us your Personal Information, thus we are striving to use commercially acceptable means of protecting it. But remember that no method of transmission over the internet, or method of electronic storage is 100% secure and reliable, and we cannot guarantee its absolute security.</p>\n\n<b>Links to Other Sites</b><br>\n\n<p>This Service may contain links to other sites. If you click on a third-party link, you will be directed to that site. Note that these external sites are not operated by us. Therefore, we strongly advise you to review the Privacy Policy of these websites. We have no control over and assume no responsibility for the content, privacy policies, or practices of any third-party sites or services.</p>\n\n<b>Children’s Privacy</b><br>\n\n<p>These Services do not address anyone under the age of 13. We do not knowingly collect personally identifiable information from children under 13 years of age. In the case we discover that a child under 13 has provided us with personal information, we immediately delete this from our servers. If you are a parent or guardian and you are aware that your child has provided us with personal information, please contact us so that we will be able to do the necessary actions.<p>\n\n<b>Scope of the agreement</b><br>\n<b>Loppekortet mediates the booking of stalls.</b><br>\n<b>Loppekortet is not responsible for the organization of the market.</b><br>\n<b>Markets:</b><br>\n<p>The organizer agrees that the Flea Market keeps information about the organizer and the organizer\'s markets. Company information is not shared with customers or third parties. Market information is published on loppekortet.dk for city owners and market visitors, and the organizer is responsible for the correctness and completeness of this information. The market organizer is free to change its own markets if no stadium bookings have yet been confirmed. Once one or more stadium bookings have been made, it is not possible to change the market page. The flea market cannot be held responsible for lost data due to system crashes, failures in subcontractors\' systems or similar.</p>\n<b>Market information:</b>\n<p>The market organizer is responsible for ensuring that the material used by the market organizer, e.g. text and images, does not infringe the rights of third parties. The Flea Market cannot be held liable for the market organizer’s material and the market organizer is obliged to indemnify the Flea Market in all respects for any costs incurred in connection with possible infringements.</p>\n<b>Cancellation:</b>\n<p>Should the market organizer find it necessary to cancel a market, the market organizer must notify the Flea Market as soon as possible. This must be done before the scheduled start of the market and within a reasonable time. The Flea Market will then refund the money paid by the bookers as soon as possible. The Flea Card fee and payment charges will not be refunded.</p>\n<b>Prices and fees:</b>\n<p>The market organizer sets the entry prices for the market and the prices for each stand at the market. The Flea Card will charge a fee to the bookers of the stands, which will accrue exclusively to the Flea Card. The following fees apply to market bookings through the Flea Card:</p>\n<b>Stadium price Flea Card fee:</b>\n<p>The card/payment fee is automatically charged through the Quickpay payment system. This fee is charged by the redeemers NETS for Dankort and Clearhaus for VISA and MasterCard and will automatically be the fee set by the redeemer. Find out more at www.nets.dk and www.clearhaus.com respectively.</p>\n\n<b>Settlement:</b>\n<p>When booking a market stall, the Flea Card will receive payment from the stall booker. Loppekortet will pay the market price to the market organiser, provided that the market has been held and the purchase has been made. The payment is due within 3 working days after the end of the market. In the event of cancellation, the Market Card shall be able to reimburse the Stadium Booker\'s payment and final payment to the Market Organiser shall therefore be made after the Market has taken place.</p>\n<b>Cancellation:</b>\n<p>If the market organizer does not carry out the market, the market organizer, the bankruptcy estate of the market organizer or the person(s) to whom the market organizer may have transferred the rights under this contract shall not be entitled to any remuneration for the cancelled/non-carried out market(s) and the Flea Market shall refund the purchase price minus ticket and payment fees to the market buyers. The market organizer cannot claim any amount from either the Flea Market or the city buyers in respect of markets not held unless they are directly responsible for the cancellation. The Flea Market is not obliged to pay interest on any amount to either the market organizer or the city buyers.</p>\n<b>Liability:</b>\n<p>The Flea Market is solely responsible for arranging the booking of stall space.</p>\n<p>The Flea Market is not responsible for the organization of the market and assumes no liability towards the market buyers for the actions of the market organizers.</p>\n<p>The market organizer alone is responsible for the accuracy and legality of the information entered on the market organizer website www.loppekortet.dk. Should the Flea Market receive a charge from NETS, TELLER or any other payment processor for reimbursement of card payments, the amount will be charged to the Market Organizer and the amount will be set off against the Market Organizer outstanding balance. If the Market Organizer has no outstanding balance with the Flea Card, the Market Organizer shall pay the Flea Card the invoiced amount within 7 days.</p>\n<p>PAYMENT is made immediately after confirmation of the order.</p>\n<p>Remember to add details of name and market when paying.</p>\n<p>In case of cancellation later than 30 days before the registered market, 50% of the market fee will be refunded. Cancellations later than 15 days before the registered market will not be refunded.\nWhen you enter into an agreement with Loppekortet regarding the price of your ticket to our Flea and Flea Market, you simultaneously consent to us collecting, registering, storing, and processing your personal data in accordance with the Personal Data Act. This concerns your name, address, telephone number, e-mail address and CVR number (if applicable). You can at any time view the information we hold about you, and you can always ask us to delete and/or correct information.</p>\n\n<b>Changes to This Privacy Policy</b><br>\n\n<p>We may update our Privacy Policy from time to time. Thus, you are advised to review this page periodically for any changes. We will notify you of any changes by posting the new Privacy Policy on this page.</p>\n\n<p>This policy is effective as of 2022-04-18</p>\n\n<b>Contact Us</b><br>\n\n<p>If you have any questions or suggestions about our Privacy Policy, do not hesitate to contact us at fatalisme@gmail.com.</p>\n\n</body>\n</html>\n', '<!DOCTYPE html> \n<html> \n<head> \n	<title>Servicevilkår</title> \n</head> \n<body>  \n\n	<b style=\"font-weight: 600 !important;\">Privatlivspolitik</b><br>\n\n	<p>Skattekortet har bygget loppekortet-appen som en Open Source-app. Denne SERVICE leveres af Skattekortet uden omkostninger og er beregnet til brug som den er.</p>\n\n	<p>Denne side bruges til at informere besøgende om vores politikker med indsamling, brug og videregivelse af personlige oplysninger, hvis nogen besluttede at bruge vores Tjeneste.</p>\n\n	<p>Hvis du vælger at bruge vores Tjeneste, accepterer du indsamling og brug af oplysninger i forhold til denne politik. De personlige oplysninger, som vi indsamler, bruges til at levere og forbedre tjenesten. Vi vil ikke bruge eller dele dine oplysninger med andre end dem, der er beskrevet i denne politik om beskyttelse af personlige oplysninger.</p>\n\n	<p>De udtryk, der anvendes i denne privatlivspolitik, har samme betydning som i vores vilkår og betingelser, som er tilgængelige på loppekortet, medmindre andet er defineret i denne privatlivspolitik.</p>\n\n	<b>Informationsindsamling og brug</b><br>\n\n	<p>For at få en bedre oplevelse, mens du bruger vores tjeneste, kan vi kræve, at du giver os visse personligt identificerbare oplysninger, herunder, men ikke begrænset til, navn,e-mail,profil. De oplysninger, som vi anmoder om, vil blive opbevaret af os og brugt som beskrevet i denne fortrolighedspolitik.</p>\n\n	<p>Appen bruger tjenester fra tredjeparter, som kan indsamle oplysninger, der bruges til at identificere dig.</p>\n\n	<p>Link til privatlivspolitikken for tredjepartstjenesteudbydere, der anvendes af appen</p>\n\n	<ul>\n		<li>Google Play-tjenester</li>\n		<li>Google Analytics for Firebase</li>\n		<li>Firebase Crashlytics</li>\n		<li>Facebook</li>\n	</ul>\n\n	<b>Logdata</b><br>\n\n	<p>Vi vil gerne informere dig om, at når du bruger vores tjeneste, indsamler vi i tilfælde af en fejl i appen data og oplysninger (via tredjepartsprodukter) på din telefon kaldet logdata. Disse logdata kan omfatte oplysninger såsom din enheds internetprotokol (\"IP\")-adresse, enhedens navn, operativsystemversion, appens konfiguration, når du bruger vores tjeneste, tidspunkt og dato for din brug af tjenesten og andre statistikker.</p>\n\n	<b>Cookies</b><br>\n\n	<p>Cookies er filer med en lille mængde data, der almindeligvis bruges som anonyme unikke identifikatorer. De sendes til din browser fra de websteder, som du besøger, og gemmes i din enheds interne hukommelse.</p>\n\n	<p>Denne tjeneste bruger ikke disse \"cookies\" eksplicit. Appen kan dog bruge kode og biblioteker fra tredjeparter, der bruger \"cookies\" til at indsamle oplysninger og forbedre deres tjenester. Du har mulighed for enten at acceptere eller afvise disse cookies og vide, når der sendes en cookie til din enhed. Hvis du vælger at afvise vores cookies, kan du muligvis ikke bruge visse dele af denne tjeneste.</p>\n\n	<b>Tjenesteudbydere</b><br>\n\n	<p>Vi kan ansætte tredjepartsvirksomheder og -personer af følgende årsager:</p>\n\n	<ul>\n		<li>For at lette vores tjeneste;</li>\n		<li>Til at levere Tjenesten på vores vegne;</li>\n		<li>For at udføre Tjenesten-relaterede tjenester; eller</li>\n		<li>For at hjælpe os med at analysere, hvordan vores Tjeneste bruges.</li>\n	</ul>\n\n	<p>Vi ønsker at informere brugerne af denne Tjeneste om, at disse tredjeparter har adgang til deres personlige oplysninger. Grunden er at udføre de opgaver, der er tildelt dem på vores vegne. De er dog forpligtet til ikke at videregive eller bruge oplysningerne til andre formål.</p>\n\n	<b>Sikkerhed</b><br>\n\n	<p>Vi værdsætter din tillid til at give os dine Personlige Oplysninger, og derfor bestræber vi os på at bruge kommercielt acceptable midler til at beskytte dem. Men husk, at ingen transmissionsmetode over internettet eller metode til elektronisk lagring er 100 % sikker og pålidelig, og vi kan ikke garantere den absolutte sikkerhed.</p>\n\n	<b>Link til andre websteder</b><br>\n\n	<p>Denne tjeneste kan indeholde links til andre websteder. Hvis du klikker på et link fra en tredjepart, vil du blive ledt til det pågældende websted. Bemærk, at disse eksterne websteder ikke drives af os. Vi anbefaler derfor kraftigt, at du gennemgår disse websteders privatlivspolitik. Vi har ingen kontrol over og påtager os intet ansvar for indholdet, fortrolighedspolitikken eller praksis på tredjepartswebsteder eller -tjenester.</p>\n\n	<b>Børns privatliv</b><br>\n\n	<p>Disse tjenester henvender sig ikke til personer under 13 år. Vi indsamler ikke bevidst personligt identificerbare oplysninger fra børn under 13 år. I tilfælde af at vi opdager, at et barn under 13 år har givet os personlige oplysninger, sletter vi dem straks fra vores servere. Hvis du er forælder eller værge, og du er klar over, at dit barn har givet os personlige oplysninger, bedes du kontakte os, så vi kan foretage de nødvendige handlinger.</p>\n\n	<b>Aftalens omfang:</b><br>\n	<b>Loppekortet formidler booking af stadepladser.</b><br>\n	<b>Loppekortet er ikke ansvarlige for afholdelse af markedet.</b><br>\n	<b>Markeder:</b><br>\n	<p>Arrangøren accepterer, at Loppekortet opbevarer information om arrangøren og arrangørens markeder. Virksomhedsinformation bliver ikke delt med kunder eller tredjepart. Markedsinformation offentliggøres på loppekortet.dk til stadelejere og markedsgæster, og arrangøren har ansvaret for, at denne information er korrekt og fyldestgørende. Markedsarrangøren kan frit ændre i egne markeder, hvis der endnu ikke er bekræftet nogen stadebookinger. Når en eller flere stadebookinger er gennemført er det ikke muligt at ændre i markedssiden. Loppekortet kan ikke gøres ansvarlig for mistede data grundet systemnedbrud, svigt i underleverandørers systemer eller lign.</p>\n	<b>Markedsinformation:</b>\n	<p>Markedsarrangøren er ansvarlig for, at markedsarrarrangørens anvendte materiale, f.eks. tekst og billeder ikke krænker tredjemands rettigheder. Loppekortet kan ikke drages til ansvar for markedsarrangørens materiale, og markedsarrangøren har pligt til i enhver henseende at skadesløsholde Loppekortet for enhver omkostning i forbindelse med mulige retskrænkelser.</p>\n	<b>Aflysning:</b>\n	<p>Skulle markedsarrangøren finde det nødvendigt at aflyse et marked skal markedsarrangøren hurtigts muligt gøre Loppekortet opmærksom på dette. Det skal ske inden markedets planlagte start og inden for rimelig tid. Loppekortet vil derefter tilbageføre stadebookeres penge så hurtigt som muligt. Loppekortets gebyr og betalingsgebyrer tilbageføres ikke.</p>\n	<b>Priser og gebyrer:</b><br>\n	<p>Markedsarrangøren fastsætter selv markeders indgangspriser og priserne for hver enkelt stade på det pågældende marked. Loppekortet opkræver et gebyr hos stadebookere, der alene tilfalder Loppekortet. Følgende gebyrer gælder for markedsbooking gennem Loppekortet:</p>\n	<b>Stadepris	 Og Loppekortets gebyr:</b>\n	<p>Kort-/betalingsgebyr opkræves automatisk gennem betalingssystemet Quickpay. Dette gebyr opkræves af indløserne NETS for Dankort og Clearhaus for VISA og MasterCard og vil automatisk være det af indløseren fastsatte gebyr. Find mere på hhv. www.nets.dk og www.clearhaus.com.</p>\n	<b>Afregning:</b>\n	<p>Ved booking af markedsstader modtager Loppekortet betaling fra stadebookeren. Loppekortet udbetaler den betalte stadepris til markedsarrangøren, under forudsætning af at markedet er afholdt og købet er effektueret. Udbetalingen forfalder til betaling inden for 3 arbejdsdage efter markedets afslutning. Loppekortet skal i tilfælde af aflysning kunne refundere stadebookerens betaling, og endelig udbetaling til markedsarrangøren foretages derfor efter markedets gennemførelse.</p>\n\n\n	<b>Aflysning:</b>\n	<p>Såfremt markedsarrangøren ikke gennemfører markedet, er markedsarrangøren, markedsarrangørens konkursbo eller den eller de som markedsarrangøren måtte have overført rettighederne til i henhold til denne kontrakt ikke berettiget til noget vederlag for det/de aflyste/ikke gennemførte markeder, og Loppekortet refunderer købesummen med fradrag af billet- og betalingsgebyrer til stadekøberne. Markedsarrangøren kan ikke rejse krav overfor hverken Loppekortet eller stadekøberne om betaling af noget beløb i anledning af ikke afholdte markeder medmindre disse er direkte skyld i aflysningen. Loppekortet er ikke forpligtet til at forrente noget beløb over for hverken markedsarrangøren eller stadekøberne.</p>\n	<b>Ansvar:</b>\n	<p>Loppekortet er alene ansvarlige for at formidle booking af stadeplads.</p>\n	<p>Loppekortet er ikke ansvarlige for afholdelse af markedet og påtager sig intet ansvar over for stadekøberne for markedsarrangørenes gøren.</p>\n	<p>Markedsarrangøren alene er ansvarlig for rigtigheden og lovligheden af de oplysninger, der indtastes på markedsarrangørens marked på www.loppekortet.dk. Skulle Loppekortet modtage opkrævning fra NETS, TELLER eller anden betalingsformidler på tilbagebetaling af kortbetaling, viderefaktureres beløbet til markedsarrangøren, og beløbet modregnes i markedsarrangørens tilgodehavende beløb. Såfremt markedsarrangøren ikke har noget tilgodehavende beløb hos Loppekortet skal markedsarrangøren inden 7 dage betale Loppekortet det fakturerede beløb.</p>\n \n	<p>BETALING foretages umiddelbart efter bekræftelse af bestilling.</p>\n	<p>Husk at tilføje oplysninger om navn og marked når du betaler.</p>\n	<p>Ved afbud senere end 30 dage før det tilmeldte marked refunderes 50% af stadelejen. Ved afbud senere end 15 dage før det tilmeldte marked refunderes stadelejen ikke.</p>\n	<p>Når du indgår aftale med Loppekortet omkring stadeleje til vore Loppe- og Kræmmermarkeder, giver du samtidige samtykke til, at vi må indsamle, registrere, opbevare og behandle dine personoplysninger i henhold til persondatalovgivningen. Det drejer sig om navn, adresse, telefonnummer, mailadresse og evt. CVRnr. Du kan til enhver tid få indsigt i hvilke oplysninger vi har om dig, ligesom du altid kan få os til at slette og/eller rette oplysninger.</p>\n\n	<b>Ændringer i denne privatlivspolitik</b><br>\n\n	<p>Vi kan opdatere vores privatlivspolitik fra tid til anden. Du anbefales derfor at gennemgå denne side regelmæssigt for at se eventuelle ændringer. Vi vil underrette dig om eventuelle ændringer ved at offentliggøre den nye fortrolighedspolitik på denne side.</p>\n\n	<p>Denne politik er gældende fra 2022-04-18</p>\n\n	<b>Kontakt os</b><br>\n\n	<p>Hvis du har spørgsmål eller forslag vedrørende vores privatlivspolitik, skal du ikke tøve med at kontakte os på fatalisme@gmail.com.</p>\n\n</body> \n</html>', '1', '0', '2021-10-30 11:40:08', '2022-04-18 10:32:56'),
(7, 'flea_data', '{\"url\":\"https:\\/\\/www.loppekortet.dk\\/uploads\\/howitworks\\/hiw.mp4\",\"thumbnail\":\"https:\\/\\/www.loppekortet.dk\\/uploads\\/default_market.jpg\",\"description\":\"<p>Our vision to be able to gather all recycling on one platform, so it will be as easy as possible to navigate the many fantastic flea markets, recycled stores and vintage shops located around the country.</p><p>Markets and shops that give used things new life, so these things are not just thrown away, but recycled again and again.</p><p>With every recycling purchase, we can save nature for new production!</p><p>The textile industry is a major culprit, especially in poor countries, where unimaginable amounts of toxic substances are flushed directly out in the nature to produce clothing.</p><p>Therefore, recycled clothes are a huge help to nature, but also to you as a consumer, it takes a long time before the chemicals are out of the clothes.</p><p>This can provide some thought about clothes for our children, which we would like to take care of, not be exposed to chemicals and other harmful things.</p><p>We hope that with this platform we can help increase recycling and help the nature!</p>\"}\n', '{\"url\":\"https:\\/\\/www.loppekortet.dk\\/uploads\\/howitworks\\/hiw.mp4\",\"thumbnail\":\"https:\\/\\/www.loppekortet.dk\\/uploads\\/default_market.jpg\",\"description\":\"<p>Det er vores vision at kunne samle alt genbrug på en platform, så det bliver så nemt som muligt at kunne navigere i de mange fantastiske loppemarkeder, genbrugsbutikker og vintagebutikker som ligger rundt i hele landet.</p><p>Markeder og butikker som giver brugte ting nyt liv, så tingene ikke bare bliver smidt ud, men genanvendt igen og igen</p><p>Vi kan med hvert genbrugskøb, spare naturen for at der skal produceres nyt!</p><p>Især textilindustrien er en stor synder især i de fattige lande, hvor der bliver skyllet ufattelige mængder af giftige stoffer direkte ud i naturen for at producere tøj.</p><p>Derfor er genbrugstøj en kæmpe hjælpe til naturen, men også til dig som forbruger, da det tager lang tid og mange vaske, før kemikalierne er ude af tøjet.</p><p>Dette kan give stof til eftertanke omkring tøj til vores børn, som vi jo gerne skal passe på, ikke bliver udsat for kemikalier og andre skadelige ting.</p><p>Vi håber at vi med denne app og hjemmeside kan være med til at øge genbruget og dermed hjælpe naturen!</p>\"}', '1', '0', '2021-11-03 12:37:09', '2022-03-08 04:54:00'),
