(9, 'rentspace_termsofconditions', '<!DOCTYPE html><html><head><title>Rent Space Terms & Conditions</title></head><body><b>Scope of the agreement</b><p>Loppekortet mediates the booking of stalls.</p><p>Loppekortet is not responsible for the organization of the market.</p><b>Markets:</b><p>The organizer agrees that the Flea Market keeps information about the organizer and the organizer\'s markets. Company information is not shared with customers or third parties. Market information is published on loppekortet.dk for city owners and market visitors, and the organizer is responsible for the correctness and completeness of this information. The market organizer is free to change its own markets if no stadium bookings have yet been confirmed. Once one or more stadium bookings have been made, it is not possible to change the market page. The flea market cannot be held responsible for lost data due to system crashes, failures in subcontractors\' systems or similar.</p><b>Market information:</b><p>The market organizer is responsible for ensuring that the material used by the market organizer, e.g. text and images, does not infringe the rights of third parties. The Flea Market cannot be held liable for the market organizer’s material and the market organizer is obliged to indemnify the Flea Market in all respects for any costs incurred in connection with possible infringements.</p><b>Cancellation:</b><p>Should the market organizer find it necessary to cancel a market, the market organizer must notify the Flea Market as soon as possible. This must be done before the scheduled start of the market and within a reasonable time. The Flea Market will then refund the money paid by the bookers as soon as possible. The Flea Card fee and payment charges will not be refunded.</p><b>Prices and fees:</b><p>The market organizer sets the entry prices for the market and the prices for each stand at the market. The Flea Card will charge a fee to the bookers of the stands, which will accrue exclusively to the Flea Card. The following fees apply to market bookings through the Flea Card:</p><b>Stadium price Flea Card fee:</b><p>The card/payment fee is automatically charged through the Quickpay payment system. This fee is charged by the redeemers NETS for Dankort and Clearhaus for VISA and MasterCard and will automatically be the fee set by the redeemer. Find out more at www.nets.dk and www.clearhaus.com respectively.</p><b>Settlement:</b><p>When booking a market stall, the Flea Card will receive payment from the stall booker. Loppekortet will pay the market price to the market organiser, provided that the market has been held and the purchase has been made. The payment is due within 3 working days after the end of the market. In the event of cancellation, the Market Card shall be able to reimburse the Stadium Booker\'s payment and final payment to the Market Organiser shall therefore be made after the Market has taken place.</p><b>Cancellation:</b><p>If the market organizer does not carry out the market, the market organizer, the bankruptcy estate of the market organizer or the person(s) to whom the market organizer may have transferred the rights under this contract shall not be entitled to any remuneration for the cancelled/non-carried out market(s) and the Flea Market shall refund the purchase price minus ticket and payment fees to the market buyers. The market organizer cannot claim any amount from either the Flea Market or the city buyers in respect of markets not held unless they are directly responsible for the cancellation. The Flea Market is not obliged to pay interest on any amount to either the market organizer or the city buyers.</p><b>Liability:</b><p>The Flea Market is solely responsible for arranging the booking of stall space.</p><p>The Flea Market is not responsible for the organization of the market and assumes no liability towards the market buyers for the actions of the market organizers.</p><p>The market organizer alone is responsible for the accuracy and legality of the information entered on the market organizer website www.loppekortet.dk. Should the Flea Market receive a charge from NETS, TELLER or any other payment processor for reimbursement of card payments, the amount will be charged to the Market Organizer and the amount will be set off against the Market Organizer outstanding balance. If the Market Organizer has no outstanding balance with the Flea Card, the Market Organizer shall pay the Flea Card the invoiced amount within 7 days.</p><p>PAYMENT is made immediately after confirmation of the order.</p><p>Remember to add details of name and market when paying.</p><p>In case of cancellation later than 30 days before the registered market, 50% of the market fee will be refunded. Cancellations later than 15 days before the registered market will not be refunded.</p><p>When you enter into an agreement with Loppekortet regarding the price of your ticket to our Flea and Flea Market, you simultaneously consent to us collecting, registering, storing, and processing your personal data in accordance with the Personal Data Act. This concerns your name, address, telephone number, e-mail address and CVR number (if applicable). You can at any time view the information we hold about you, and you can always ask us to delete and/or correct information.</p></body></html>', '<!DOCTYPE html><html><head><title>Rent Space Terms & Conditions</title></head><body><b>Aftalens omfang:</b><p>Loppekortet formidler booking af stadepladser.</p><p>Loppekortet er ikke ansvarlige for afholdelse af markedet.</p><b>Markeder:</b><p>Arrangøren accepterer, at Loppekortet opbevarer information om arrangøren og arrangørens markeder. Virksomhedsinformation bliver ikke delt med kunder eller tredjepart. Markedsinformation offentliggøres på loppekortet.dk til stadelejere og markedsgæster, og arrangøren har ansvaret for, at denne information er korrekt og fyldestgørende. Markedsarrangøren kan frit ændre i egne markeder, hvis der endnu ikke er bekræftet nogen stadebookinger. Når en eller flere stadebookinger er gennemført er det ikke muligt at ændre i markedssiden. Loppekortet kan ikke gøres ansvarlig for mistede data grundet systemnedbrud, svigt i underleverandørers systemer eller lign.</p><b>Markedsinformation:</b><p>Markedsarrangøren er ansvarlig for, at markedsarrarrangørens anvendte materiale, f.eks. tekst og billeder ikke krænker tredjemands rettigheder. Loppekortet kan ikke drages til ansvar for markedsarrangørens materiale, og markedsarrangøren har pligt til i enhver henseende at skadesløsholde Loppekortet for enhver omkostning i forbindelse med mulige retskrænkelser.</p><b>Aflysning:</b><p>Skulle markedsarrangøren finde det nødvendigt at aflyse et marked skal markedsarrangøren hurtigts muligt gøre Loppekortet opmærksom på dette. Det skal ske inden markedets planlagte start og inden for rimelig tid. Loppekortet vil derefter tilbageføre stadebookeres penge så hurtigt som muligt. Loppekortets gebyr og betalingsgebyrer tilbageføres ikke.</p><b>Priser og gebyrer:</b><p>Markedsarrangøren fastsætter selv markeders indgangspriser og priserne for hver enkelt stade på det pågældende marked. Loppekortet opkræver et gebyr hos stadebookere, der alene tilfalder Loppekortet. Følgende gebyrer gælder for markedsbooking gennem Loppekortet:</p>\n<b>Stadepris Og Loppekortets gebyr:</b><p>Kort-/betalingsgebyr opkræves automatisk gennem betalingssystemet Quickpay. Dette gebyr opkræves af indløserne NETS for Dankort og Clearhaus for VISA og MasterCard og vil automatisk være det af indløseren fastsatte gebyr. Find mere på hhv. www.nets.dk og www.clearhaus.com.</p><b>Afregning:</b><p>Ved booking af markedsstader modtager Loppekortet betaling fra stadebookeren. Loppekortet udbetaler den betalte stadepris til markedsarrangøren, under forudsætning af at markedet er afholdt og købet er effektueret. Udbetalingen forfalder til betaling inden for 3 arbejdsdage efter markedets afslutning. Loppekortet skal i tilfælde af aflysning kunne refundere stadebookerens betaling, og endelig udbetaling til markedsarrangøren foretages derfor efter markedets gennemførelse.</p><b>Aflysning:</b><p>Såfremt markedsarrangøren ikke gennemfører markedet, er markedsarrangøren, markedsarrangørens konkursbo eller den eller de som markedsarrangøren måtte have overført rettighederne til i henhold til denne kontrakt ikke berettiget til noget vederlag for det/de aflyste/ikke gennemførte markeder, og Loppekortet refunderer købesummen med fradrag af billet- og betalingsgebyrer til stadekøberne. Markedsarrangøren kan ikke rejse krav overfor hverken Loppekortet eller stadekøberne om betaling af noget beløb i anledning af ikke afholdte markeder medmindre disse er direkte skyld i aflysningen. Loppekortet er ikke forpligtet til at forrente noget beløb over for hverken markedsarrangøren eller stadekøberne.</p><b>Ansvar:</b><p>Loppekortet er alene ansvarlige for at formidle booking af stadeplads.</p><p>Loppekortet er ikke ansvarlige for afholdelse af markedet og påtager sig intet ansvar over for stadekøberne for markedsarrangørenes gøren.</p><p>Markedsarrangøren alene er ansvarlig for rigtigheden og lovligheden af de oplysninger, der indtastes på markedsarrangørens marked på www.loppekortet.dk. Skulle Loppekortet modtage opkrævning fra NETS, TELLER eller anden betalingsformidler på tilbagebetaling af kortbetaling, viderefaktureres beløbet til markedsarrangøren, og beløbet modregnes i markedsarrangørens tilgodehavende beløb. Såfremt markedsarrangøren ikke har noget tilgodehavende beløb hos Loppekortet skal markedsarrangøren inden 7 dage betale Loppekortet det fakturerede beløb.</p><p>BETALING foretages umiddelbart efter bekræftelse af bestilling.</p><p>Husk at tilføje oplysninger om navn og marked når du betaler.</p><p>Ved afbud senere end 30 dage før det tilmeldte marked refunderes 50% af stadelejen. Ved afbud senere end 15 dage før det tilmeldte marked refunderes stadelejen ikke.</p><p>Når du indgår aftale med Loppekortet omkring stadeleje til vore Loppe- og Kræmmermarkeder, giver du samtidige samtykke til, at vi må indsamle, registrere, opbevare og behandle dine personoplysninger i henhold til persondatalovgivningen. Det drejer sig om navn, adresse, telefonnummer, mailadresse og evt. CVRnr. Du kan til enhver tid få indsigt i hvilke oplysninger vi har om dig, ligesom du altid kan få os til at slette og/eller rette oplysninger.</p></body></html>', '1', '0', '2021-10-30 17:10:08', '2022-01-12 06:05:12');
